const ConvenienceFacilities = () => {
  const [imageAnimations] = useState(
    facilities.map(() => [
      new Animated.Value(-100), // Initial Y offset for image1
      new Animated.Value(-150), // Initial Y offset for image2
      new Animated.Value(-200), // Initial Y offset for image3
    ])
  );

  useEffect(() => {
    // Animate all images to their original positions
    facilities.forEach((_, index) => {
      Animated.stagger(200, [
        Animated.timing(imageAnimations[index][0], {
          toValue: 0, // Original position
          duration: 500,
          useNativeDriver: true,
        }),
        Animated.timing(imageAnimations[index][1], {
          toValue: 0, // Original position
          duration: 700,
          useNativeDriver: true,
        }),
        Animated.timing(imageAnimations[index][2], {
          toValue: 0, // Original position
          duration: 900,
          useNativeDriver: true,
        }),
      ]).start();
    });
  }, [imageAnimations]);
  const [animations] = useState(facilities.map(() => new Animated.Value(0))); // Array of Animated Values
  const scaleAnim = useRef(new Animated.Value(1)).current; // For scaling effect

  useEffect(() => {
    // Animate each card one by one with a delay
    Animated.stagger(150, animations.map((anim, index) =>
      Animated.spring(anim, {
        toValue: 1,
        friction: 4, // Smooth transition with reduced friction
        tension: 80, // Higher tension for a snappier effect
        useNativeDriver: true,
        delay: index * 120, // Increase the delay for a more elegant stagger effect
      })
    )).start();
  }, [animations]);

  // Handling press animation (hover effect)
  const handlePressIn = () => {
    Animated.spring(scaleAnim, {
      toValue: 0.96, // Slightly more zoomed-in effect for the press
      friction: 4,
      tension: 80,
      useNativeDriver: true,
    }).start();
  };

  const handlePressOut = () => {
    Animated.spring(scaleAnim, {
      toValue: 1,
      friction: 4,
      tension: 80,
      useNativeDriver: true,
    }).start();
  };
  const [scaleValue] = useState(new Animated.Value(1));
  const flatListRef = useRef(null);
  const [fadeInValue] = useState(new Animated.Value(0));

  let currentIndex = 0;

  useEffect(() => {
    const interval = setInterval(() => {
      currentIndex = (currentIndex + 1) % footerData.length;
      flatListRef.current.scrollToIndex({ index: currentIndex, animated: true });
    }, 3000);

    Animated.timing(fadeInValue, {
      toValue: 1,
      duration: 1500,
      useNativeDriver: true,
    }).start();

    return () => clearInterval(interval);
  }, []);

  const onPressIn = () => {
    Animated.timing(scaleValue, {
      toValue: 0.95,
      duration: 150,
      useNativeDriver: true,
      easing: Easing.inOut(Easing.ease),
    }).start();
  };

  const onPressOut = () => {
    Animated.timing(scaleValue, {
      toValue: 1,
      duration: 150,
      useNativeDriver: true,
    }).start();
  };

  const renderFacility = ({ item, index }) => (
    <Animated.View
      style={[
        styles.card,
        {
          opacity: animations[index],
          transform: [
            {
              translateY: animations[index].interpolate({
                inputRange: [0, 1],
                outputRange: [30, 0], // Move from 30px down to normal position
              }),
            },
            {
              scale: animations[index].interpolate({
                inputRange: [0, 1],
                outputRange: [0.9, 1], // Scale from 0.9 to 1
              }),
            },
          ],
          shadowOffset: {
            width: 0,
            height: 20, // Larger shadow for more depth
          },
          shadowOpacity: animations[index].interpolate({
            inputRange: [0, 1],
            outputRange: [0, 0.25], // Fade in shadow opacity for more elegance
          }),
          shadowRadius: 12, // Larger shadow radius for premium look
        },
      ]}
    >
      <View
        style={styles.cardContent}
        onTouchStart={handlePressIn}
        onTouchEnd={handlePressOut}
      >
        {/* Image Collage Container */}
        <View style={styles.imageContainer}>
          <Animated.Image
            source={{ uri: item.image[0] }}
            style={[styles.collageImage, styles.image1,
            { transform: [{ translateY: imageAnimations[index][0] }] },
            ]} // First image stays at base position
          />
          <Animated.Image

            source={{ uri: item.image[1] }}
            style={[styles.collageImage, styles.image2,
            { transform: [{ translateY: imageAnimations[index][1] }] },
            ]} // Second image climbs up
          />
          <Animated.Image
            source={{ uri: item.image[2] }}

            style={[styles.collageImage, styles.image3,
            { transform: [{ translateY: imageAnimations[index][2] }] },
            ]} // Third image climbs down
          />
        </View>

        <View style={styles.textContainer}>
          <Text style={styles.cardTitle}>{item.title}</Text>
          <Text style={styles.cardDescription}>{item.description}</Text>
        </View>
      </View>
    </Animated.View>
  );

  const renderTestimonial = ({ item }) => (
    <View style={styles.testimonialCard}>
      <Image source={{ uri: item.image }} style={styles.testimonialImage} resizeMode='center' />
      <Text style={styles.testimonialName}>{item.name}</Text>
      <Text style={styles.testimonialText}>{item.text}</Text>
    </View>
  );
  const renderFooterItem = ({ item }) => (
    <View style={styles.footerItem}>
      <Ionicons name={item.icon} size={30} color="white" />
      <Text style={styles.footerValue}>{item.value}</Text>
      <Text style={styles.footerDescription}>{item.description}</Text>
    </View>
  );

  return (
    <ScrollView style={styles.container} showsVerticalScrollIndicator={false}>
      {/* Hero Section */}
      <LinearGradient colors={['#595959', '#404040', '#333333']} style={styles.heroSection}>
        <Animated.Text style={[styles.heroTitle, { transform: [{ scale: scaleValue }] }]}>
          Experience Unmatched Convenience
        </Animated.Text>
        <Text style={styles.heroSubtitle}>
          Facilities designed to make your campus life smooth and enjoyable.
        </Text>
      </LinearGradient>

      {/* Facilities Section */}
      <Text style={styles.sectionHeader}>Convenient Facilities</Text>
      <FlatList
        data={facilities}
        renderItem={renderFacility}
        keyExtractor={(item) => item.id}
        contentContainerStyle={styles.list}
      />

      {/* Achievements Section */}
      <Text style={styles.sectionHeader}>Our Achievements</Text>
      {achievements.map((achievement) => (
        <View key={achievement.id} style={styles.achievementCard}>
          <Text style={styles.achievementTitle}>{achievement.title}</Text>
          <Text style={styles.achievementDescription}>{achievement.description}</Text>
        </View>
      ))}

      {/* New Section: Testimonials */}
      <Text style={styles.sectionHeader}>What Our Students Say</Text>
      <FlatList
        data={testimonials}
        renderItem={renderTestimonial}
        keyExtractor={(item) => item.id}
        horizontal
        contentContainerStyle={styles.testimonialList}
        showsHorizontalScrollIndicator={false}
      />


      {/* Footer Section */}
      <View>
        <LinearGradient colors={['#595959', '#404040', '#333333']} style={styles.footerContainer}>
          <Text style={styles.footerTitle}>Statistics That Reflect Excellence</Text>
          <FlatList
            ref={flatListRef}
            data={footerData}
            renderItem={renderFooterItem}
            keyExtractor={(item) => item.id}
            horizontal
            contentContainerStyle={styles.footerList}
            showsHorizontalScrollIndicator={false}
          />
        </LinearGradient>
      </View>
    </ScrollView>
  );
};

